import React from 'react';
import AppHeader from './header.js'; 
import './AppDashboard.css'; // Make sure you have the CSS file for styling

function AppDashboard() {
  return (
    <>
      <AppHeader />
      <div className="dashboard-container">
        <p>For any questions or concerns, please email us at <a href="mailto:wanderlogixs@gmai.conm">wanderlogixs.conm</a></p>
        {/* Add other dashboard elements here */}
      </div>
    </>
  );
}

export default AppDashboard;
